import React from "react";

function OneInner() {
  return (
    <div className="f-one-inner">
      <h2 className="f-header-one-inner">Visual Words</h2> <br />
      <p className="f-text-one-inner">
        Font families are important for friendly reading. Information can be
        inviting and easy to digest at first point of visual contact.
      </p>
    </div>
  );
}

export default OneInner;
